    //得到定制化的图标顺序
    function getcustomMadeIconObj(hide, renew) {
        const hideConfig = gm.get(gm.HIDE, {});
        const sortConfig = gm.get(gm.SORT, []);
        log('hideConfig: ', hideConfig);
        log('sortConfig: ', sortConfig);
        const customMadeIconObj = [];
        const tempObj = [];
        var iconsDataNew = {};

        iconsDataOld['iconArrayc'].forEach(function (obj, index) {//数组
            if (hide && !isNotNull(hideConfig[obj.name])) {
                tempObj.push(obj);
            } else if (!hide) {
                tempObj.push(obj);
            }
        });

        // sort
        const sorted = {};
        sortConfig.forEach(name => {
            Object.values(tempObj).forEach(function (tObj, index) {
                if (name == tObj.name) {
                    customMadeIconObj.push(tObj);
                    sorted[name] = true;
                }
            });
        });

        Object.values(tempObj).forEach(function (tObj, index) {
            if (!isNotNull(sorted[tObj.name])) {
                customMadeIconObj.push(tObj);
            }
        });


        for (var i in iconsDataOld) {  //遍历obj对象，把它的所有成员赋值给对象obj1
            iconsDataNew[i] = iconsDataOld[i];
        }
        iconsDataNew['iconArrayc'] = customMadeIconObj;
        log('customMadeIconObj: ', customMadeIconObj);
        return iconsDataNew;
    }

